import React, { Component } from 'react'


export function About(props) {
    if (props.about) {
        return null;
    }

    return (
        <div className="about-container">
            <div className="about_section">
                <div>
                    <img className="avatar" src="../static/images/Cave_Johnson.png"></img>
                </div>
                <div className="about_text">
                <h1>ABOUT</h1>
                <p>Movie, sci-fi and over all tech geek that always seeks out new and interesting
                    things to experience and learn.  I strive to keep an open mind on everything because
                    you never know what kind of hidden truths await those who pay attention.
                </p>
                </div>
            </div>
        </div>
    );
}

export default About;
